import React, { Component } from 'react'

export default class TodoElement extends Component {
    render() {
        return (
            <div key={index} className="row" >
                <h1 style={textStyle} >{tasks.name}</h1>
                <Button onClick={() => this.deleteTodo(tasks.id)} style={buttonStyle} className="ml-auto">Delete</Button>
            </div>
        )
    }
}
